INSERT INTO `uni_services_ads` VALUES (1,'Поднять в ТОП поиска и выделить маркером',99,0,7,'ТОП объявления показываются на самых верхних позициях и на всех страницах рубрики и региона, в которой размещено объявление. Такое расположение гарантирует, что Ваши объявления просмотрят максимально возможное количество пользователей. Покупатели Вас точно не пропустят!',1,'827124_services5.png',1,2,1),(2,'VIP размещение',99,0,7,'Ваше объявление будет отображаться в специальном блоке в результатах поиска и на карточках объявлений о продаже аналогичных товаров.',2,'641729_vipiconbig.png',1,4,1),(3,'Срочное размещение',59,0,7,'Пометьте объявление как срочное до тех пор, пока вы не продадите свой товар. - вы привлекаете больше внимания, а значит получаете больше откликов - ваше объявление становится более заметным среди других предложений',4,'353435_if_Fire_116853.png',1,5,1),(4,'Турбо продажи 4x',149,75,1,'Ваше предложение увидит максимум посетителей — это увеличит шансы на быструю и выгодную продажу. Объявление будет выделено цветом, поднято в топ, размещено в специальном блоке в каталоге объявлений и в результате поиска, а также помечено как срочное объявление.',3,'768381_apps.png',2,1,1);
